import React, { Fragment, useEffect, useState } from "react";
// import { CgMouse } from "react-icons/all";
import "./Home.css";
import ProductCard from "./ProductCard.js";
import MetaData from "../layout/MetaData";
import { clearErrors, getProduct } from "../../actions/productAction";
import { useSelector, useDispatch } from "react-redux";
import Loader from "../layout/Loader/Loader";
import { useAlert } from "react-alert";
import MainTodo from "../EmailList/MainTodo";

const Home = () => {
  const alert = useAlert();
  const dispatch = useDispatch();
  const { loading, error, products } = useSelector((state) => state.products);
  // const [showPopup, setShowPopup] = useState(false);
  const [showPopup, setShowPopup] = useState(false);

  useEffect(() => {
    if (error) {
      alert.error(error);
      dispatch(clearErrors());
    }
    dispatch(getProduct());
  }, [dispatch, error, alert]);

  const [email, setEmail] = useState({
    email: ""
  });

  const { emails } = email;

  const emailSubmit = (e) => {
    e.preventDefault();

    const myForm = new FormData();
    myForm.set("email", email);
    console.log("Email Submitted");
    // dispatch(register(myForm));

  };

  const addEmail = (e) => {

    setEmail({ ...email, [e.target.emails]: e.target.value });
  };


  useEffect(() => {
    const timeLimit = 5;
    let i = 0;

    const timer = setInterval(() => {
      i++;
      if (i === timeLimit) {
        clearInterval(timer);
        setShowPopup(true);
      }
      console.log(i);
    }, 1000);

    const handleClickOutside = (event) => {
      const popup = document.getElementById('popup');
      if (!event.target.closest('.popup__box') && popup.classList.contains('show')) {
        setShowPopup(false);
        console.log('remove');
      }
    };

    // const handleClickOutside = (event) => {
    //   const popup = document.getElementById('popup');
    //   if (!event.target.matches('.popup__box') && popup.classList.contains('show')) {
    //     setShowPopup(false);
    //     console.log('remove');
    //   }
    // };

    window.addEventListener('click', handleClickOutside);

    return () => {
      clearInterval(timer);
      window.removeEventListener('click', handleClickOutside);
    };
  }, []);


  const [todos, setTodos] = useState([]);

  const addTodo = (todo) => {
    setTodos([...todos, todo]);
  }




  return (
    <Fragment>
      {loading ? (
        <Loader />
      ) : (<>

        <div className={showPopup ? 'popup show' : 'popup'} id="popup">
          <div>
            <div className="popup__box">
              <div className="popup__box--h1">
                <h1>Love rant sessions?</h1>
                <h1>us too...</h1>
              </div>
              <div className="popup__box--h3">
                <h3>
                  <span className="letter--1">s</span>
                  <span className="letter--2">o</span>
                  <span className="letter--3">w</span>
                  <span className="letter--4">h</span>
                  <span className="letter--5">y</span>
                  <span className="letter--6">n</span>
                  <span className="letter--7">o</span>
                  <span className="letter--8">t</span>
                  <span className="letter--9">d</span>
                  <span className="letter--10">o</span>
                  <span className="letter--11">i</span>
                  <span className="letter--12">t</span>
                  <span className="letter--13">t</span>
                  <span className="letter--14">o</span>
                  <span className="letter--15">g</span>
                  <span className="letter--16">e</span>
                  <span className="letter--17">t</span>
                  <span className="letter--18">h</span>
                  <span className="letter--19">e</span>
                  <span className="letter--20">r</span>
                </h3>
              </div>
              <div className="popup__box--p">
                <p>
                  subscribe to our news letter for weekly rant sessions, exclusive shop
                  updates and (sshh don't tell anyone) discount codes
                </p>
              </div>
              <form onSubmit={emailSubmit} >
                <div className="btn popup__box--button">
                  {/* <MailOutlineIcon /> */}
                  <input
                    type="email"
                    placeholder="Email"
                    name="email"
                    value={email}
                    onChange={addEmail}
                  />
                </div>
                {/* <MainTodo addTodo={addTodo} /> */}
                {/* <a href="" className="btn popup__box--button">
                  subscribe now
                </a> */}
                <input type="submit" value="SubmitEmail" className="signUpBtn" />
              </form>
            </div>
          </div>
        </div>

        <section className="description__main">
          <div>
            <div className="description__img">
              <img src="" alt="" />
            </div>
            <div className="description__intro">
              <div className="shop__categories">
                <div className="shop__categories--left">
                  <h3>shop by category</h3>
                  <ul className="shop__by__category">
                    <li>
                      <a href="./categories/categories.html">scented candles</a>
                    </li>
